svg.script:


	function init(evt)
	{
	    if ( window.svgDocument == null )
	    {
		svgDocument = evt.target.ownerDocument;
	    }

	    tooltip = svgDocument.getElementById('tooltip');
	    tooltip_bg = svgDocument.getElementById('tooltip_bg');

	}

	function ShowTooltip(evt, mouseovertext)
	{
      var zoomLevel = 2 ;
      var adjustY = 90
	    tooltip.setAttributeNS(null,"x",evt.clientX/zoomLevel+5);
	    tooltip.setAttributeNS(null,"y",evt.clientY/zoomLevel+13 + adjustY);
	    tooltip.firstChild.data = mouseovertext;
	    tooltip.setAttributeNS(null,"visibility","visible");

	    length = tooltip.getComputedTextLength();
	    tooltip_bg.setAttributeNS(null,"width",length+4);
	    tooltip_bg.setAttributeNS(null,"x",evt.clientX/zoomLevel+3);
	    tooltip_bg.setAttributeNS(null,"y",evt.clientY/zoomLevel+3 + adjustY);
	    tooltip_bg.setAttributeNS(null,"visibility","visibile");
	}

	function HideTooltip(evt)
	{
	    tooltip.setAttributeNS(null,"visibility","hidden");
	    tooltip_bg.setAttributeNS(null,"visibility","hidden");
	}
	function showProperty(propertyId)
	{     
    //  var redirectURL = "/Property/PropertyDetail/" + propertyId;
     // window.open(redirectURL, "_blank");  
     window.parent.ParentFunction(propertyId);
	}
